  base: *id013
  body: "When including the dependency @com_github_grpc_grpc//:grpc_opencensus_plugin\
    \ in a cc_library it fails to compile with the following message:\r\n\r\nexternal/com_github_grpc_grpc/src/cpp/ext/filters/census/server_filter.cc:\
    \ In static member function 'static void grpc::CensusServerCallData::OnDoneRecvInitialMetadataCb(void*,\
    \ grpc_error*)':\r\nexternal/com_github_grpc_grpc/src/cpp/ext/filters/census/server_filter.cc:96:32:\
    \ error: 'StrCat' was not declared in this scope\r\ncalld->qualified_method_ =\
    \ StrCat(\"Recv.\", calld->method_);\r\n                                     \
    \          ^~~~~~\r\nexternal/com_github_grpc_grpc/src/cpp/ext/filters/census/server_filter.cc:96:32:\
    \ note: suggested alternative:\r\nIn file included from external/com_github_grpc_grpc/src/cpp/ext/filters/census/server_filter.cc:23:0:\r\
    \nexternal/com_google_absl/absl/strings/str_cat.h:318:41: note: 'absl::StrCat'\r\
    \nABSL_MUST_USE_RESULT inline std::string StrCat(const AlphaNum& a, const AlphaNum&\
    \ b,\r\n                                                                     \
    \     ^~~~~~\r\n\r\nHowever, running bazel build grpc_opencensus_plugin completes\
    \ just fine? Not sure how, but this call should be qualified anyway as it's not\
    \ using-declared in the file."
